import React from 'react'

class StatDist extends React.Component {

    state = {
        statVals: []
    }

    handleClick = (e) => {
        this.props.getStat(e.target.value)
    }
    render(){
        return(
            <div>
                {this.props.strength === 0 ? <button onClick={this.handleClick} value="strength">Strength</button> : null }
                {this.props.dexterity === 0 ? <button value='dexterity' onClick={this.handleClick}>Dexterity</button> : null }
                {this.props.constitution === 0 ? <button value='constitution' onClick={this.handleClick}>Constitution</button> : null }
                {this.props.intelligence === 0 ? <button value="intelligence" onClick={this.handleClick}>Intelligence</button> : null }
                {this.props.wisdom === 0 ? <button value='wisdom' onClick={this.handleClick}>Wisdom</button> : null }
                {this.props.charisma === 0 ? <button value='charisma' onClick={this.handleClick}>Charisma</button> : null }
            </div>
        )
    }
}

export default StatDist
